import React from "react";
// import { Field, reduxForm } from "redux-form";

let ReceiptForm = ({ addReceipt }) => {
  return (
    <form onSubmit={addReceipt}>
      <div>
        <input type="text" placeholder="Receipt Name" />
      </div>
      <div>
        <label htmlFor="receiptSource">Receipt Source</label>
        <Field name="receiptSource" component="input" type="text" />
      </div>
      <div>
        <label htmlFor="preparationTime">Preparation Time</label>
        <Field name="preparationTime" component="input" type="text" />
      </div>
      <button type="submit">Submit</button>
    </form>
  );
};

ReceiptForm = reduxForm({
  form: "receipt",
})(ReceiptForm);

export default ReceiptForm;
// Recipe name
// - Recipe source (where we have obtained the recipe)
// - List of ingredients
// - Preparation time
// - Preparation instructions.
